import React from "react";
import { Link, Element } from "react-scroll"; // Import Element as well if needed
import logo from "../assets/img/logo.png";

export default function Header() {
  return (
    <div className="header-container max-w-[1200px] mx-auto p-3 bg-[#fdffff4d] sticky top-0 flex justify-between duration-300 shadow-2xl rounded-br-3xl rounded-bl-3xl">
      <a href="/">
        <div className="logo border-[#61dafb] border-2 rounded-lg">
          <img src={logo} className="h-[50px]" alt="Logo" />
        </div>
      </a>

      <ul className="flex text-white  justify-center items-center flex-row gap-5 text-[20px]">
        <li className=" hover:scale-110 duration-300 ease-in-out">
          <Link to="main" spy={true} smooth={true} offset={-70} duration={500}>
            Home
          </Link>
        </li>

        <li>
          <Link to="about" spy={true} smooth={true} offset={-70} duration={500}>
            About Me
          </Link>
        </li>

        <li>
          <Link
            to="experience"
            spy={true}
            smooth={true}
            offset={-70}
            duration={500}
          >
            Experience
          </Link>
        </li>

        <li>
          <Link
            to="Project"
            spy={true}
            smooth={true}
            offset={-70}
            duration={500}
          >
            Project
          </Link>
        </li>
      </ul>
    </div>
  );
}
